function add_traveler_row(price,rooms,age,order_room){
 
 
if(order_room>0){
    	var option=new Array();
	$.each(rooms, function( index, value ) {
	   option.push('<option value= '+value['room_id']+'>'+value['room_name']+'</option>');
	});
	var traveler_age=new Array();
	$.each(age, function( index, value ) {
		traveler_age.push('<option value= '+value['age_id']+'>'+value['age_name']+'</option>');
	});

	var n = ($('#add_traveler_row tr').length - 1) + 1;
	$("#add_traveler_row").append('<tr><td><input class="form-control" type="text" name="traveler_name['+n+']" required ></td><td><input class="form-control" type="number" name="traveler_code['+n+']" required ></td><td><select class="form-control" name="traveler_age['+n+']">'+traveler_age+'</select></td><td><select class="form-control order_room_type" name="room_type['+n+']">'+option+'</select></td><td class="price">'+price+'</td><td><input type="checkbox" name="traveler_submit['+n+']" class="form-control"/></td><td class="minus"> <span class="fa fa-remove"></span> </td></tr>');

}else
{
    	var traveler_age=new Array();
	$.each(age, function( index, value ) {
		traveler_age.push('<option value= '+value['age_id']+'>'+value['age_name']+'</option>');
	});

	var n = ($('#add_traveler_row tr').length - 1) + 1;
	$("#add_traveler_row").append('<tr><td><input class="form-control" type="text" name="traveler_name['+n+']" required ></td><td><input type="number" name="traveler_code['+n+']" class="form-control" required ></td><td><select class="form-control" name="traveler_age['+n+']">'+traveler_age+'</select></td><td class="price">'+price+'</td><td>-</td><td class="minus"> <span class="fa fa-remove"></span></td></tr>');

    
}

var total=0;
$('.price').each(function(){
    total=total+parseInt($(this).text())
})
$('.new_price').text(total);
$('#order_price').val(total);

$('.distance').text(parseInt($('.new_price').text())-parseInt($('.old_price').text()));


}
$(document).ready(function(){ $("#add_traveler_row").on("click", ".fa-remove", function() { $(this).closest('tr').remove(); var total=0;
$('.price').each(function(){
    total=total+parseInt($(this).text())
})
$('.new_price').text(total);
$('#order_price').val(total);

$('.distance').text(parseInt($('.new_price').text())-parseInt($('.old_price').text()));});})
$('#reagent_modal').click(function(e){
    $('li > a[href="#login_ref_tab"]').tab("show");
});
$('#customer_login_btn').click(function(e){
    $('li > a[href="#login_tab"]').tab("show");
});





